import React from 'react';
import { Comment } from './Comment';
import { styled } from 'styled-components';

const CommentsContainer = styled.main`
    width: 80%;
`

const Comments = ({data}) => {
    return (
    <main>
    {
        data.map((e)=><Comment key={e._id} data={e} />)
    }
    </main>
    );
};

export default Comments;
